import './App.css';
import {BrowserRouter as Router} from 'react-router-dom';
import Home from './pages/Home';
import { Friends } from './pages/Friends';

function App() {
  return (
    <Router >
      <Home />

      <Router exact path="/" component={Home} />
      <Router exact path="/friends" componennt={Friends} />
    </Router>

  );
}

export default App;
